import React, { useState, useEffect } from "react";

function Products() {
  const [data, setData] = useState([]);
  const [filter, setFilter] = useState(data);
  const [loading, setLoading] = useState(false);

  let componentMounted = true;

  useEffect(() => {
    const getproduct = async () => {
      setLoading(true);
      const response = await fetch("https://fakestoreapi.com/products");
      if (componentMounted) {
        setData(await response.clone().json());
        setFilter(await response.json());
        setLoading(false);
        console.log(filter);
      }
      return () => {
        componentMounted(false);
      };
    };
    getproduct();
  }, []);
  const Loading = () => {
    return <>Loading....</>;
  };

  const ShowProduct = () => {
    return (
      <div className="buttons">
        <button className="btn btn-outline-dark">All</button>
        <button className="btn btn-outline-dark">men's Clothing</button>
        <button className="btn btn-outline-dark">women's Clothing</button>
        <button className="btn btn-outline-dark">Electronics</button>
        <button className="btn btn-outline-dark">jwellary</button>

      </div>
    );
  };

  return (
    <div>
      <div className="container my-5 py-5">
        <div className="row">
          <div className="col-12 mb-5">
            <h1 className="display-6 fw-bolder text-center">LATEST PRODUCT</h1>
            <hr />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Products;
